import React from 'react'

function Navbar() {
  return (
    <nav>
      <a href="/home/">home</a> |
      <a href="/menu/">menu</a> |
      <a href="/about/">about</a> |
      <a href="/contact/">contact</a>
    </nav>
  )
}

export default Navbar
